    const [token, setToken] = useState('');

    let submitForgetUser = async val => {
        console.log(val);
        await loginUser.get(
            '/auth/resetpassword',
            {
                params : {
                    email:val
                }
            }
        )
        .then((response) => {
            console.log(response);
            if(response.data.success){
                props.callToaster({toastShow:true,toastMsg: "User Registered Successfully!",toastBG:"success"});
            }
        })
        .catch((err)=>{
            props.callToaster({toastShow:true,toastMsg: "Something went wrong!",toastBG:"danger"});
        });

    }

    return(
        <div>

            <VerifyPassword onSubmit={submitForgetUser}></VerifyPassword>

        </div>
    );

}

